import React, { useState, useEffect } from 'react';
import api from '../../api/endpoint';
import { FiHeart, FiCalendar, FiUser, FiThermometer, FiSearch, FiEye } from 'react-icons/fi';

const MesConsultations = () => {
  const [consultations, setConsultations] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [searchTerm, setSearchTerm] = useState('');

  useEffect(() => {
    loadConsultations();
  }, []);

  const loadConsultations = async () => {
    try {
      setLoading(true);
      setError(null);
      const data = await api.getData('/consultations/patient');
      setConsultations(Array.isArray(data) ? data : []);
    } catch (err) {
      console.error('Erreur consultations:', err);
      setError(err.message || 'Impossible de charger les consultations.');
      setConsultations([]);
    } finally {
      setLoading(false);
    }
  };

  const filteredConsultations = consultations.filter(c => 
    c.patientId?.fullName?.toLowerCase().includes(searchTerm.toLowerCase())
  );

  const getStatusColor = (statut) => {
    switch (statut) {
      case 'TERMINEE': return 'bg-green-100 text-green-800';
      case 'EN_COURS': return 'bg-yellow-100 text-yellow-800';
      case 'ANNULEE': return 'bg-red-100 text-red-800';
      default: return 'bg-gray-100 text-gray-800';
    }
  };

  if (loading) {
    return (
      <div className="flex items-center justify-center min-h-[400px] p-6">
        <div className="text-center">
          <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-blue-600 mx-auto mb-4"></div>
          <p className="text-lg text-gray-600">Chargement consultations...</p>
        </div>
      </div>
    );
  }

  return (
    <div className="p-6 max-w-7xl mx-auto">
      <div className="mb-12">
        <h1 className="text-4xl font-bold text-gray-900 flex items-center gap-4 mb-2">
          <FiHeart size={48} className="text-red-500" />
          Mes Consultations ({filteredConsultations.length})
        </h1>
        
        <div className="relative max-w-md">
          <FiSearch className="absolute left-4 top-1/2 transform -translate-y-1/2 text-gray-400" size={20} />
          <input
            type="text"
            placeholder="Rechercher consultation..."
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
            className="w-full pl-12 pr-6 py-3 border-2 border-gray-200 rounded-2xl focus:ring-4 focus:ring-blue-100"
          />
        </div>
      </div>

      {error && (
        <div className="bg-red-50 border-2 border-red-200 text-red-800 px-6 py-4 rounded-2xl mb-8">
          {error}
        </div>
      )}

      {filteredConsultations.length === 0 ? (
        <div className="text-center py-20 bg-white rounded-3xl shadow-lg">
          <FiHeart size={64} className="mx-auto mb-6 text-gray-400" />
          <h3 className="text-2xl font-bold text-gray-900 mb-2">Aucune consultation</h3>
          <p className="text-lg text-gray-600">Vos consultations apparaîtront ici</p>
        </div>
      ) : (
        <div className="bg-white rounded-3xl shadow-2xl overflow-hidden">
          <table className="w-full">
            <thead className="bg-gradient-to-r from-gray-50 to-gray-100">
              <tr>
                <th className="px-8 py-6 text-left text-sm font-bold text-gray-900">Médecin</th>
                <th className="px-8 py-6 text-left text-sm font-bold text-gray-900">Date</th>
                <th className="px-8 py-6 text-left text-sm font-bold text-gray-900">Statut</th>
              </tr>
            </thead>
            <tbody className="divide-y divide-gray-200">
              {filteredConsultations.map((consultation) => (
                <tr key={consultation._id} className="hover:bg-gray-50">
                  <td className="px-8 py-6">
                    <div className="flex items-center gap-3">
                      <FiUser size={20} className="text-blue-600" />
                      <span>{consultation.medecinId?.fullName || 'N/A'}</span>
                    </div>
                  </td>
                  <td className="px-8 py-6">{new Date(consultation.dateConsultation).toLocaleDateString('fr-FR')}</td>
                  <td className="px-8 py-6">
                    <span className={`px-4 py-2 rounded-full text-sm font-semibold ${getStatusColor(consultation.statut)}`}>
                      {consultation.statut}
                    </span>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
};

export default MesConsultations;
